import React from 'react';

const SettingsIcon = ({ className, width = 20, height = 20 }) => (
  <svg 
    className={`settings-icon ${className || ''}`}
    width={width}
    height={height}
    viewBox="0 0 20 20"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
  >
    <circle cx="10" cy="10" r="3" stroke="currentColor" strokeWidth="1.5"/>
    <path d="M10 1v6m0 6v6m9-7h-6m-6 0H1m15.5-3.5l-4.24 4.24m-8.48 0L7.5 6.5m0 8.48L13.74 10.26m4.24 4.24L13.74 10.26" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round"/>
  </svg>
);

export default SettingsIcon;
